        $arrNewStatusesToCreate = [];
        foreach ($arrDefaultStatuses as $arrNewStatus) {
            foreach ($arrCompanyIds as $companyId) {
                if (isset($arrAlreadyCreatedStatusesGrouped[$companyId][strtolower($arrNewStatus['client_status_name'])])) {
                    continue;
                }

                $arrNewStatusesToCreate[] = [
                    'company_id'         => $companyId,
                    'client_status_name' => $arrNewStatus['client_status_name'],
                ];
            }
        }

        $this->table('client_statuses')
            ->insert($arrNewStatusesToCreate)
            ->save();

        echo 'Created new statuses for all companies' . PHP_EOL;

        // Get just created new statuses for the default company
        $statement = $this->getQueryBuilder()
            ->select('*')
            ->from('client_statuses')
            ->where([
                'client_status_name IN' => $arrCreatedNewStatuses,
