            ->execute();

        $arrDefaultCreatedStatuses = $statement->fetchAll('assoc');

        $arrStatusesMapping = [];
        foreach ($arrDefaultCreatedStatuses as $arrDefaultStatus) {
            $arrStatusesMapping[$arrDefaultStatus['company_id']][$arrDefaultStatusesGrouped[strtolower($arrDefaultStatus['client_status_name'])]] = $arrDefaultStatus['client_status_id'];

            if (empty($arrDefaultStatus['company_id'])) {
                // Update parent record of the status
                $this->getQueryBuilder()
                    ->update('client_statuses')
