                        'client_status_parent_id' => $arrDefaultStatus['client_status_id']
                    ])
                    ->where(function (QueryExpression $exp) use ($arrDefaultStatus) {
                        return $exp
                            ->eq('client_status_name', $arrDefaultStatus['client_status_name'])
                            ->isNull('client_status_parent_id')
                            ->notEq('company_id', 0);
                    })
                    ->execute();
            }
        }

        echo 'Updated parents of statuses for all companies' . PHP_EOL;

        // ***********************
        // Create Statuses Lists
        // ***********************

        $arrDefaultStatusesListsGrouped = [];
