        $arrDefaultCreatedStatusesLists = $statement->fetchAll('assoc');

        $arrStatusesListsMapping = [];
        foreach ($arrDefaultCreatedStatusesLists as $arrDefaultStatusList) {
            $arrStatusesListsMapping[$arrDefaultStatusList['company_id']][$arrDefaultStatusesListsGrouped[strtolower($arrDefaultStatusList['client_status_list_name'])]] = $arrDefaultStatusList['client_status_list_id'];
            if (empty($arrDefaultStatusList['company_id'])) {
                // Update parent record of the status list
                $this->getQueryBuilder()
                    ->update('client_statuses_lists')
                    ->set([
                        'client_status_list_parent_id' => $arrDefaultStatusList['client_status_list_id']
                    ])
                    ->where(function (QueryExpression $exp) use ($arrDefaultStatusList) {
                        return $exp
                            ->eq('client_status_list_name', $arrDefaultStatusList['client_status_list_name'])
                            ->isNull('client_status_list_parent_id')
                            ->notEq('company_id', 0);
                    })
                    ->execute();
            }
        }

        echo 'Updated parents of statuses lists for all companies' . PHP_EOL;


        // ***********************
        // Statuses Lists and Statuses Mapping
        // ***********************

        $arrStatusesListsMappingToCreate = [];
        foreach ($arrDefaultListsMapping as $arrDefaultListMappingRecord) {
            foreach ($arrCompanyIds as $companyId) {
                if (!isset($arrStatusesListsMapping[$companyId][$arrDefaultListMappingRecord['client_status_list_id']])) {
                    $fp = fopen('d:/log.txt', 'a');
                    fwrite($fp, print_r($arrStatusesListsMapping, true) . PHP_EOL);
                    fclose($fp);
                    exit('ERROR: No mapping for status list ' . $arrDefaultListMappingRecord['client_status_list_id']);
                }

                if (!isset($arrStatusesMapping[$companyId][$arrDefaultListMappingRecord['client_status_id']])) {
                    $fp = fopen('d:/log.txt', 'a');
                    fwrite($fp, print_r($arrStatusesMapping, true) . PHP_EOL);
                    fclose($fp);
                    exit('ERROR: No mapping for list ' . $arrDefaultListMappingRecord['client_status_id']);
                }

                $arrStatusesListsMappingToCreate[] = [
                    'client_status_list_id'    => $arrStatusesListsMapping[$companyId][$arrDefaultListMappingRecord['client_status_list_id']],
                    'client_status_id'         => $arrStatusesMapping[$companyId][$arrDefaultListMappingRecord['client_status_id']],
                    'client_status_list_order' => $arrDefaultListMappingRecord['client_status_list_order'],
                ];
            }
        }


        $this->table('client_statuses_lists_mapping_to_statuses')
            ->insert($arrStatusesListsMappingToCreate)
            ->save();

        echo 'Created a mapping for statuses and statuses lists' . PHP_EOL;


        // ***********************
        // Case Types
        // ***********************

        $arrDefaultCaseTypesGrouped = [];
        foreach ($arrDefaultCaseTypes as $arrDefaultCaseType) {
            $arrDefaultCaseTypesGrouped[strtolower($arrDefaultCaseType['client_type_name'])] = $arrDefaultCaseType['client_type_id'];
        }

        $arrNewCaseTypesToCreate  = [];
        $arrCreatedCaseTypesNames = [];
        foreach ($arrDefaultCaseTypes as $arrDefaultCaseType) {
            $arrCreatedCaseTypesNames[] = $arrDefaultCaseType['client_type_name'];

            foreach ($arrCompanyIds as $companyId) {
                if (!isset($arrStatusesListsMapping[$companyId][$arrDefaultCaseType['client_status_list_id']])) {
                    $fp = fopen('d:/log.txt', 'a');
                    fwrite($fp, print_r($arrStatusesListsMapping, true) . PHP_EOL);
                    fclose($fp);

                    exit('ERROR: No mapping for status list (case type) ' . $arrDefaultCaseType['client_status_list_id']);
                }

                $arrNewCaseTypesToCreate[] = [
                    'company_id'                       => $companyId,
                    'client_status_list_id'            => $arrStatusesListsMapping[$companyId][$arrDefaultCaseType['client_status_list_id']],
                    'client_type_name'                 => $arrDefaultCaseType['client_type_name'],
                    'client_type_case_reference_as'    => $arrDefaultCaseType['client_type_case_reference_as'],
                    'client_type_needs_ia'             => $arrDefaultCaseType['client_type_needs_ia'],
                    'client_type_employer_sponsorship' => $arrDefaultCaseType['client_type_employer_sponsorship'],
                    'client_type_created_on'           => $arrDefaultCaseType['client_type_created_on']
                ];
            }
        }

        $this->table('client_types')
            ->insert($arrNewCaseTypesToCreate)
            ->save();

        echo 'Created new case types for all companies' . PHP_EOL;

        // Get just created new case types
        $statement = $this->getQueryBuilder()
            ->select('*')
            ->from('client_types')
            ->where([
                'client_type_name IN' => $arrCreatedCaseTypesNames,
            ])
            ->execute();

        $arrCreatedCaseTypes = $statement->fetchAll('assoc');

        $arrCaseTypesMapping = [];
        foreach ($arrCreatedCaseTypes as $arrCreatedCaseTypeRecord) {
            $arrCaseTypesMapping[$arrCreatedCaseTypeRecord['company_id']][$arrDefaultCaseTypesGrouped[strtolower($arrCreatedCaseTypeRecord['client_type_name'])]] = $arrCreatedCaseTypeRecord['client_type_id'];
            if (empty($arrCreatedCaseTypeRecord['company_id'])) {
                // Update parent record of the status list
                $this->getQueryBuilder()
                    ->update('client_types')
                    ->set([
                        'parent_client_type_id' => $arrCreatedCaseTypeRecord['client_type_id']
                    ])
                    ->where(function (QueryExpression $exp) use ($arrCreatedCaseTypeRecord) {
                        return $exp
                            ->eq('client_type_name', $arrCreatedCaseTypeRecord['client_type_name'])
                            ->isNull('parent_client_type_id')
                            ->notEq('company_id', 0);
                    })
                    ->execute();
            }
        }

        echo 'Updated parents of case types for all companies' . PHP_EOL;


        // ***********************
        // Case Types Kinds
        // ***********************

        $arrNewCaseTypesKindsToCreate = [];
        foreach ($arrDefaultCaseTypesKinds as $arrDefaultCaseTypeKind) {
            foreach ($arrCompanyIds as $companyId) {
                if (!isset($arrCaseTypesMapping[$companyId][$arrDefaultCaseTypeKind['client_type_id']])) {
                    $fp = fopen('d:/log.txt', 'a');
                    fwrite($fp, print_r($arrCaseTypesMapping, true) . PHP_EOL);
                    fclose($fp);

                    exit('ERROR: No mapping for case type kind ' . $arrDefaultCaseTypeKind['client_type_id']);
                }

                $arrNewCaseTypesKindsToCreate[] = [
                    'client_type_id' => $arrCaseTypesMapping[$companyId][$arrDefaultCaseTypeKind['client_type_id']],
                    'member_type_id' => $arrDefaultCaseTypeKind['member_type_id'],
                ];
            }
        }

        $this->table('client_types_kinds')
            ->insert($arrNewCaseTypesKindsToCreate)
            ->save();


        // ***********************
        // Create new Categories
        // ***********************

        $arrNewCategoriesToCreate           = [];
        $arrDefaultCategoriesMapping        = [];
        $arrDefaultCategorysMappingReversed = [];
        foreach ($arrDefaultCategories as $arrDefaultCategory) {
            foreach ($arrCompanyIds as $companyId) {
                if (!isset($arrCaseTypesMapping[$companyId][$arrDefaultCategory['client_type_id']])) {
                    $fp = fopen('d:/log.txt', 'a');
                    fwrite($fp, print_r($arrCaseTypesMapping, true) . PHP_EOL);
                    fclose($fp);

                    exit('ERROR: No mapping for case type (categories) ' . $arrDefaultCategory['client_type_id']);
                }

                if (!isset($arrStatusesListsMapping[$companyId][$arrDefaultCategory['client_status_list_id']])) {
                    $fp = fopen('d:/log.txt', 'a');
                    fwrite($fp, print_r($arrStatusesListsMapping, true) . PHP_EOL);
                    fclose($fp);

                    exit('ERROR: No mapping for status list (case type) ' . $arrDefaultCategory['client_status_list_id']);
                }

                $arrNewCategoryInsert = [
                    'company_id'                       => $companyId,
                    'client_type_id'                   => $arrCaseTypesMapping[$companyId][$arrDefaultCategory['client_type_id']],
                    'client_status_list_id'            => $arrStatusesListsMapping[$companyId][$arrDefaultCategory['client_status_list_id']],
                    'client_category_name'             => $arrDefaultCategory['client_category_name'],
                    'client_category_abbreviation'     => $arrDefaultCategory['client_category_abbreviation'],
                    'client_category_link_to_employer' => $arrDefaultCategory['client_category_link_to_employer'],
                    'client_category_order'            => $arrDefaultCategory['client_category_order'],
                ];

                // Create groups for the default company first, later use these ids
                if (empty($companyId)) {
                    $statement = $this->getQueryBuilder()
                        ->insert(array_keys($arrNewCategoryInsert))
                        ->into('client_categories')
                        ->values($arrNewCategoryInsert)
                        ->execute();

                    // Save the mapping
                    $createdCategoryId = $statement->lastInsertId('client_categories');

                    $arrDefaultCategoriesMapping[$arrDefaultCategory['client_category_id']] = $createdCategoryId;

                    $arrDefaultCategorysMappingReversed[$createdCategoryId] = $arrDefaultCategory['client_category_id'];
                } else {
                    $arrNewCategoryInsert['client_category_parent_id'] = $arrDefaultCategoriesMapping[$arrDefaultCategory['client_category_id']];

                    $arrNewCategoriesToCreate[] = $arrNewCategoryInsert;
                }
            }
        }

        $this->table('client_categories')
            ->insert($arrNewCategoriesToCreate)
            ->save();

        echo 'Created new categories for all companies' . PHP_EOL;

        // Get just created new categories
        $statement = $this->getQueryBuilder()
            ->select('*')
            ->from('client_categories')
            ->where(function (QueryExpression $exp, Query $query) use ($arrDefaultCategoriesMapping) {
                $firstCondition = $query->newExpr()
                    ->in('client_category_id', array_values($arrDefaultCategoriesMapping));

                $secondCondition = $query->newExpr()
                    ->in('client_category_parent_id', array_values($arrDefaultCategoriesMapping));

                return $exp->or([
                    $firstCondition,
                    $secondCondition
                ]);
            })
            ->execute();

        $arrCreatedCategories = $statement->fetchAll('assoc');

        $arrCategoriesMapping = [];
        foreach ($arrCreatedCategories as $arrCreatedCategoryInfo) {
            $oldCategoryId = empty($arrCreatedCategoryInfo['client_category_parent_id']) ? $arrDefaultCategorysMappingReversed[$arrCreatedCategoryInfo['client_category_id']] : $arrDefaultCategorysMappingReversed[$arrCreatedCategoryInfo['client_category_parent_id']];

            $arrCategoriesMapping[$arrCreatedCategoryInfo['company_id']][$oldCategoryId] = $arrCreatedCategoryInfo['client_category_id'];
        }


        // ***********************
        // Create new Groups
        // ***********************

        $arrDefaultGroupsMapping         = [];
        $arrDefaultGroupsMappingReversed = [];
        $arrNewGroupsToCreate            = [];
        foreach ($arrDefaultGroups as $arrDefaultGroup) {
            foreach ($arrCompanyIds as $companyId) {
                if (!isset($arrCaseTypesMapping[$companyId][$arrDefaultGroup['client_type_id']])) {
                    $fp = fopen('d:/log.txt', 'a');
                    fwrite($fp, print_r($arrCaseTypesMapping, true) . PHP_EOL);
                    fclose($fp);

                    exit('ERROR: No mapping for case type (groups) ' . $arrDefaultGroup['client_type_id']);
                }

                $arrNewGroupInsert = [
                    'company_id'     => $companyId,
                    'client_type_id' => $arrCaseTypesMapping[$companyId][$arrDefaultGroup['client_type_id']],
                    'title'          => $arrDefaultGroup['title'],
                    'order'          => $arrDefaultGroup['order'],
                    'cols_count'     => $arrDefaultGroup['cols_count'],
                    'collapsed'      => $arrDefaultGroup['collapsed'],
                    'show_title'     => $arrDefaultGroup['show_title'],
                    'regTime'        => time(),
                    'assigned'       => $arrDefaultGroup['assigned']
                ];

                // Create groups for the default company first, later use these ids
                if (empty($companyId)) {
                    $statement = $this->getQueryBuilder()
                        ->insert(array_keys($arrNewGroupInsert))
                        ->into('client_form_groups')
                        ->values($arrNewGroupInsert)
                        ->execute();

                    // Save the mapping
                    $createdGroupId = $statement->lastInsertId('client_form_groups');

                    $arrDefaultGroupsMapping[$arrDefaultGroup['group_id']] = $createdGroupId;
                    $arrDefaultGroupsMappingReversed[$createdGroupId]      = $arrDefaultGroup['group_id'];
                } else {
                    $arrNewGroupInsert['parent_group_id'] = $arrDefaultGroupsMapping[$arrDefaultGroup['group_id']];

                    $arrNewGroupsToCreate[] = $arrNewGroupInsert;
                }
            }
        }

        $this->table('client_form_groups')
            ->insert($arrNewGroupsToCreate)
            ->save();

        echo 'Created new groups for all companies' . PHP_EOL;

        // Get just created new groups
        $statement = $this->getQueryBuilder()
            ->select('*')
            ->from('client_form_groups')
            ->where(function (QueryExpression $exp, Query $query) use ($arrDefaultGroupsMapping) {
                $firstCondition = $query->newExpr()
                    ->in('group_id', array_values($arrDefaultGroupsMapping));

                $secondCondition = $query->newExpr()
                    ->in('parent_group_id', array_values($arrDefaultGroupsMapping));

                return $exp->or([
                    $firstCondition,
                    $secondCondition
                ]);
            })
            ->execute();

        $arrCreatedGroups = $statement->fetchAll('assoc');

        $arrGroupsMapping = [];
        foreach ($arrCreatedGroups as $arrCreatedGroupInfo) {
            $oldGroupId = empty($arrCreatedGroupInfo['parent_group_id']) ? $arrDefaultGroupsMappingReversed[$arrCreatedGroupInfo['group_id']] : $arrDefaultGroupsMappingReversed[$arrCreatedGroupInfo['parent_group_id']];

            $arrGroupsMapping[$arrCreatedGroupInfo['company_id']][$oldGroupId] = $arrCreatedGroupInfo['group_id'];
        }


        // ***********************
        // Rename fields
        // ***********************
        $this->execute("UPDATE `client_form_fields` SET `label`='Federal File Number' WHERE `company_field_id` = 'b-file-number';");
        $this->execute("UPDATE `client_form_fields` SET `label`='Citizenship Granted Date' WHERE `company_field_id` = 'citizenship_date';");
        $this->execute("UPDATE `client_form_fields` SET `label`='WP Extension Granted' WHERE `company_field_id` = 'date_WP_extension_Grandted';");
        $this->execute("UPDATE `client_form_fields` SET `label`='WP Issued' WHERE `company_field_id` = 'date_WP_issued';");
        $this->execute("UPDATE `client_form_fields` SET `label`='Provincial File Number' WHERE `company_field_id` = 'file_number_gov_other';");
        $this->execute("UPDATE `client_form_fields` SET `label`='Tracking Number - Medical Sent' WHERE `company_field_id` = 'medical_sent_waybill_number';");
        $this->execute("UPDATE `client_form_fields` SET `label`='Authorized Representative' WHERE `company_field_id` = 'registered_migrant_agent';");
        $this->execute("UPDATE `client_form_fields` SET `label`='WP Interview' WHERE `company_field_id` = 'work_permit_interview_date';");
        $this->execute("UPDATE `client_form_fields` SET `label`='WP Interview Waiver Receipt' WHERE `company_field_id` = 'WP_interview_Waiver_receipt_date';");
        $this->execute("UPDATE `client_form_fields` SET `label`='WP Validity' WHERE `company_field_id` = 'WP_valid_till';");

        echo 'Renamed specific fields' . PHP_EOL;

        // ***********************
        // Create new fields + options
        // ***********************

        $arrDefaultAllFieldsGrouped = [];
        foreach ($arrDefaultAllFields as $arrDefaultAllFieldInfo) {
            $arrDefaultAllFieldsGrouped[$arrDefaultAllFieldInfo['field_id']] = $arrDefaultAllFieldInfo;
        }

        // Don't create a field if it was already created
        $statement = $this->getQueryBuilder()
            ->select(['field_id', 'company_field_id', 'company_id'])
            ->from('client_form_fields')
            ->execute();

        $arrAlreadyCreatedFieldsForCompanies = $statement->fetchAll('assoc');

        $maxFieldId              = 0;
        $arrAlreadyCreatedFields = [];
        foreach ($arrAlreadyCreatedFieldsForCompanies as $arrAlreadyCreatedFieldInfo) {
            $arrAlreadyCreatedFields[$arrAlreadyCreatedFieldInfo['company_id']][$arrAlreadyCreatedFieldInfo['company_field_id']] = $arrAlreadyCreatedFieldInfo['field_id'];

            $maxFieldId = max($maxFieldId, $arrAlreadyCreatedFieldInfo['field_id']);
        }


        $arrDefaultOptionsGrouped = [];
        foreach ($arrDefaultAllOptions as $arrDefauptOption) {
            $arrDefaultOptionsGrouped[$arrDefauptOption['field_id']][] = $arrDefauptOption;
        }

        $arrNewFieldsToCreate             = [];
        $arrDefaultFieldsMapping          = [];
        $arrDefaultFieldsMappingByTextId  = [];
        $arrOptionsMapping                = [];
        $arrDefaultOptionsMappingReversed = [];
        $arrSkippedFields                 = [];
        foreach ($arrDefaultAllFields as $arrNewField) {
            $arrDefaultFieldsMappingByTextId[strtolower($arrNewField['company_field_id'])] = $arrNewField['field_id'];

            foreach ($arrCompanyIds as $companyId) {
                if (isset($arrAlreadyCreatedFields[$companyId][$arrNewField['company_field_id']])) {
                    $arrSkippedFields[$companyId][$arrNewField['field_id']] = 1;

                    if (empty($companyId)) {
                        $arrDefaultFieldsMapping[$arrNewField['field_id']] = $arrAlreadyCreatedFields[$companyId][$arrNewField['company_field_id']];

                        if (isset($arrDefaultOptionsGrouped[$arrNewField['field_id']])) {
                            $statement = $this->getQueryBuilder()
                                ->select('*')
                                ->from('client_form_default')
                                ->where(['field_id' => $arrAlreadyCreatedFields[$companyId][$arrNewField['company_field_id']]])
                                ->execute();

                            $arrFieldSaverOptions = $statement->fetchAll('assoc');

                            foreach ($arrDefaultOptionsGrouped[$arrNewField['field_id']] as $arrOptionInfo) {
                                foreach ($arrFieldSaverOptions as $arrFieldSaverOptionInfo) {
                                    if ($arrFieldSaverOptionInfo['value'] == $arrOptionInfo['value']) {
                                        $arrOptionsMapping[$arrOptionInfo['form_default_id']]                          = $arrFieldSaverOptionInfo['form_default_id'];
                                        $arrDefaultOptionsMappingReversed[$arrFieldSaverOptionInfo['form_default_id']] = $arrOptionInfo['form_default_id'];
                                        break;
                                    }
                                }
                            }
                        }
                    }
                    continue;
                }

                $arrNewFieldInsert = [
                    'company_id'       => $companyId,
                    'company_field_id' => $arrNewField['company_field_id'],
                    'type'             => $arrNewField['type'],
                    'label'            => $arrNewField['label'],
                    'maxlength'        => $arrNewField['maxlength']
                ];

                if (empty($companyId)) {
                    $statement = $this->getQueryBuilder()
                        ->insert(array_keys($arrNewFieldInsert))
                        ->into('client_form_fields')
                        ->values($arrNewFieldInsert)
                        ->execute();

                    // Save the mapping
                    $createdFieldId = $statement->lastInsertId('client_form_fields');

                    $arrDefaultFieldsMapping[$arrNewField['field_id']] = $createdFieldId;

                    // Create options for combo fields in the default company
                    if (isset($arrDefaultOptionsGrouped[$arrNewField['field_id']])) {
                        foreach ($arrDefaultOptionsGrouped[$arrNewField['field_id']] as $arrOptionInfo) {
                            $arrOptionInsert = [
                                'field_id' => $createdFieldId,
                                'value'    => $arrOptionInfo['value'],
                                'order'    => $arrOptionInfo['order'],
                                'deleted'  => 'N'
                            ];

                            $statement = $this->getQueryBuilder()
                                ->insert(array_keys($arrOptionInsert))
                                ->into('client_form_default')
                                ->values($arrOptionInsert)
                                ->execute();

                            // Save the mapping
                            $createdDefaultOptionId = $statement->lastInsertId('client_form_default');

                            $arrOptionsMapping[$arrOptionInfo['form_default_id']]      = $createdDefaultOptionId;
                            $arrDefaultOptionsMappingReversed[$createdDefaultOptionId] = $arrOptionInfo['form_default_id'];
                        }
                    }
                } else {
                    $arrNewFieldInsert['parent_field_id'] = $arrDefaultFieldsMapping[$arrNewField['field_id']];

                    $arrNewFieldsToCreate[] = $arrNewFieldInsert;
                }
            }
        }

        $this->table('client_form_fields')
            ->insert($arrNewFieldsToCreate)
            ->save();

        echo 'Created new fields and default options' . PHP_EOL;

        // Generate a mapping for all companies fields
        $statement = $this->getQueryBuilder()
            ->select(['field_id', 'company_field_id', 'company_id'])
            ->from('client_form_fields')
            ->execute();

        $arrCompaniesFields = $statement->fetchAll('assoc');

        $arrFieldsMapping      = [];
        $arrCompaniesNewFields = [];
        $arrFileNumberFields   = [];
        foreach ($arrCompaniesFields as $arrCompanyFieldInfo) {
            if ($arrCompanyFieldInfo['company_field_id'] == 'b-file-number') {
                $arrFileNumberFields[] = $arrCompanyFieldInfo['field_id'];
            }

            if (!isset($arrDefaultFieldsMappingByTextId[strtolower($arrCompanyFieldInfo['company_field_id'])])) {
                // This is a custom company's field (is not default), skip it
                continue;
            }

            $arrFieldsMapping[$arrCompanyFieldInfo['company_id']][$arrDefaultFieldsMappingByTextId[strtolower($arrCompanyFieldInfo['company_field_id'])]] = $arrCompanyFieldInfo['field_id'];

            if ($arrCompanyFieldInfo['field_id'] > $maxFieldId) {
                $arrCompaniesNewFields[$arrCompanyFieldInfo['company_id']][] = $arrCompanyFieldInfo['field_id'];
            }
        }

        $arrNewFieldsOptionsToCreate = [];
        foreach ($arrDefaultOptionsGrouped as $oldFieldId => $arrOptions) {
            foreach ($arrCompanyIds as $companyId) {
                if (empty($companyId) || isset($arrSkippedFields[$companyId][$oldFieldId])) {
                    continue;
                }

                foreach ($arrOptions as $arrOptionInfo) {
                    if (!isset($arrFieldsMapping[$companyId][$oldFieldId])) {
                        $fp = fopen('d:/log.txt', 'a');
                        fwrite($fp, print_r($arrFieldsMapping, true) . PHP_EOL);
                        fclose($fp);

                        exit('ERROR: No mapping for fields options (field) ' . $oldFieldId);
                    }

                    if (!isset($arrOptionsMapping[$arrOptionInfo['form_default_id']])) {
                        $fp = fopen('d:/log.txt', 'a');
                        fwrite($fp, print_r($arrOptionsMapping, true) . PHP_EOL);
                        fclose($fp);

                        exit('ERROR: No mapping for fields options (option) ' . $arrOptionInfo['form_default_id']);
                    }

                    $arrNewFieldsOptionsToCreate[] = [
                        'parent_form_default_id' => $arrOptionsMapping[$arrOptionInfo['form_default_id']],
                        'field_id'               => $arrFieldsMapping[$companyId][$oldFieldId],
                        'value'                  => $arrOptionInfo['value'],
                        'order'                  => $arrOptionInfo['order'],
                        'deleted'                => 'N'
                    ];
                }
            }
        }

        $this->table('client_form_default')
            ->insert($arrNewFieldsOptionsToCreate)
            ->save();

        echo 'Created options for all companies' . PHP_EOL;

        // Get just created new default options
        $statement = $this->getQueryBuilder()
            ->select(['d.*', 'f.company_id'])
            ->from(array('d' => 'client_form_default'))
            ->innerJoin(array('f' => 'client_form_fields'), ['f.field_id = d.field_id'])
            ->where(function (QueryExpression $exp, Query $query) use ($arrOptionsMapping) {
